var script_f12_54_13153=[" ",
"",
"",
"function fixDP(r, dps) {",
"if (isNaN(r)) return \"NaN\";",
"var msign = '';",
"if (r < 0) msign = '-';",
"x = Math.abs(r);",
"if (x > Math.pow(10, 21)) return msign + x.toString();",
"var m = Math.round(x * Math.pow(10, dps)).toString();",
"if (dps == 0) return msign + m;",
"while (m.length <= dps) m = \"0\" + m;",
"return msign + m.substring(0, m.length - dps) + \".\" + m.substring(m.length - dps);",
"}",
"",
"var currenttimeout;",
"",
"var calctxt = ''; ",
"var xmltxt = ''; ",
"var htmtxt = ''; ",
"var currentvar = '';",
"",
"function GlycemicAssessment_fx() {",
"",
"currenttimeout = self.setTimeout('minMaxCheck();', 3000);",
"",
"with(document.GlycemicAssessment_form){",
"",
"if (currentvar == 'H1'){",
"if (H1_param.value.indexOf(',') >= 0){ H1_param.value = ''; doCalc = false; alert('Comma character not allowed'); }",
"param_value = parseFloat(H1_param.value);",
"if (isNaN(param_value)){param_value = ''; clrResults(); return;}",
"H1 = param_value;",
"",
"H2 = 10.929 * (H1 - 2.15);",
"H2_param.value = fixDP(H2,1);",
"",
"AG = (28.7 * H1) - 46.7;",
"AG_param.value = fixDP(AG,1);",
"",
"AGS = AG / 18.015;",
"AGS_param.value = fixDP(AGS,1);",
"",
"}",
"",
"if (currentvar == 'H2'){",
"if (H2_param.value.indexOf(',') >= 0){ H2_param.value = ''; doCalc = false; alert('Comma character not allowed'); }",
"param_value = parseFloat(H2_param.value);",
"if (isNaN(param_value)){param_value = \"\"; clrResults(); return;}",
"H2 = param_value;",
"",
"H1 = (H2 / 10.929) + 2.15;",
"H1_param.value = fixDP(H1,1);",
"",
"AG = (28.7 * H1) - 46.7;",
"AG_param.value = fixDP(AG,1);",
" ",
"AGS = AG / 18.015;",
"AGS_param.value = fixDP(AGS,1);",
"",
"}",
"",
"if (currentvar == 'AG'){",
"if (AG_param.value.indexOf(',') >= 0){ AG_param.value = ''; doCalc = false; alert('Comma character not allowed'); }",
"param_value = parseFloat(AG_param.value);",
"if (isNaN(param_value)){param_value = \"\"; clrResults(); return;}",
"AG = param_value;",
"",
"H1 = (AG + 46.7) / 28.7;",
"H1_param.value = fixDP(H1,1);",
"",
"H2 = 10.929 * (H1 - 2.15);",
"H2_param.value = fixDP(H2,1);",
"",
"AGS = AG / 18.015;",
"AGS_param.value = fixDP(AGS,1);",
"",
"",
"}",
"",
"",
"if (currentvar == 'AGS'){",
"if (AGS_param.value.indexOf(',') >= 0){ AGS_param.value = ''; doCalc = false; alert('Comma character not allowed'); }",
"param_value = parseFloat(AGS_param.value);",
"if (isNaN(param_value)){param_value = \"\"; clrResults(); return;}",
"AGS = param_value;",
"",
"AG = AGS * 18.015;",
"AG_param.value = fixDP(AG,1);",
"",
"H1 = (AG +46.7) / 28.7;",
"H1_param.value = fixDP(H1,1);",
"",
"H2 = 10.929 * (H1 - 2.15);",
"H2_param.value = fixDP(H2,1);",
"",
"}",
"",
"}",
"",
"}",
"",
"function minMaxCheck(){",
"",
"if (currenttimeout) self.clearTimeout(currenttimeout);",
"",
"with(document.GlycemicAssessment_form){",
"",
"if (H1_param.value && H1_param.value > 100) {",
"clrResults();",
"doCalc = false;",
"alert(\"The maximum value or result for A1C (DCCT) is 100%.\");",
"}",
"",
"}",
"",
"}",
"",
"",
"function clrResults(){",
"",
"if (currenttimeout) self.clearTimeout(currenttimeout);",
"",
"with(document.GlycemicAssessment_form){",
"H1_param.value = '';",
"H1 = 0;",
"H2_param.value = '';",
"H2 = 0;",
"AG_param.value = '';",
"AG = 0;",
"AGS_param.value = '';",
"AGS = 0;",
"}",
"",
"}",
"",
"",
""].join("\n");
