"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Radiofrequency catheter ablation for the heart (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/radiofrequency-catheter-ablation-for-the-heart-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H26834294\">",
"      <span class=\"h1\">",
"       What is radiofrequency catheter ablation?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Radiofrequency catheter ablation is a procedure that is used to treat certain conditions that cause the heart to beat too fast. This procedure is done in the hospital.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H26834301\">",
"      <span class=\"h1\">",
"       How do normal heartbeats happen?",
"      </span>",
"      &nbsp;&mdash;&nbsp;A normal heartbeat happens when an electrical signal starts in one spot near the top of the heart. This electrical signal follows a path to spread across the heart. As it spreads, the signal causes the heart muscle to squeeze. Each time the heart squeezes (&ldquo;beats&rdquo;), blood is sent all over the body. Normally, the heart beats in a regular way 60 to 80 times a minute.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H26834308\">",
"      <span class=\"h1\">",
"       What can cause the heart to beat too fast?",
"      </span>",
"      &nbsp;&mdash;&nbsp;The heart can beat too fast when:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        The electrical signal starts in the wrong part of the heart",
"       </li>",
"       <li>",
"        The electrical signal follows the wrong path as it spreads across the heart",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      People with heart problems as well as those with healthy hearts can have heartbeats that are too fast.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H26834315\">",
"      <span class=\"h1\">",
"       How does radiofrequency catheter ablation work?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Radiofrequency catheter ablation destroys the part of the heart that is creating or spreading abnormal electrical signals. After the procedure, the heart can beat normally again.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H26834322\">",
"      <span class=\"h1\">",
"       How do I get ready for the procedure?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Your doctor will tell you what to do to get ready for the procedure. For example, you might need to stop taking certain medicines.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H26834329\">",
"      <span class=\"h1\">",
"       What happens during the procedure?",
"      </span>",
"      &nbsp;&mdash;&nbsp;When the procedure starts you will get medicines to make you sleepy. Then the doctor will insert a thin tube called a &ldquo;catheter&rdquo; into a large artery (blood vessel) in your leg or another part of your body. Next he or she will guide the catheter into your heart. Using wires that are inside the catheter, the doctor will apply a special type of energy to the parts of the heart causing the fast heartbeat. This destroys that tissue, so that it can no longer affect the heartbeat. At the end of the procedure, the doctor removes the catheter and wires.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H26834336\">",
"      <span class=\"h1\">",
"       What happens after the procedure?",
"      </span>",
"      &nbsp;&mdash;&nbsp;After the procedure, your doctor or nurse will tell you which medicines you should take. He or she will also tell you which activities you should avoid.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H26834343\">",
"      <span class=\"h1\">",
"       What are some downsides of the procedure?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Downsides of the procedure can include:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Bleeding, bruising, or getting an infection in the area where the catheter was put in",
"       </li>",
"       <li>",
"        Damage to the heart from the wires",
"       </li>",
"       <li>",
"        Changes in the heartbeat &ndash; Some people who have changes in their heartbeat might need to have a pacemaker put in. A pacemaker is a device that can keep a person&rsquo;s heartbeat normal. It is put under the skin in the upper chest and has wires that connect to the heart.",
"       </li>",
"       <li>",
"        Blood clots that form in a vein and then travel to the lungs or brain",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H26834350\">",
"      <span class=\"h1\">",
"       Is radiofrequency catheter ablation the only treatment for a fast heartbeat?",
"      </span>",
"      &nbsp;&mdash;&nbsp;No. Doctors can use other treatments for a fast heartbeat. These can include medicines, procedures, or surgery.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H26834420\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
"     </p>",
"     <p>",
"      <a class=\"medical medical_basics\" href=\"UTD.htm?20/32/20994?source=see_link\">",
"       Patient information: Atrial fibrillation (The Basics)",
"      </a>",
"     </p>",
"     <p>",
"      <a class=\"medical medical_basics\" href=\"UTD.htm?22/56/23427?source=see_link\">",
"       Patient information: Wolff-Parkinson-White syndrome (The Basics)",
"      </a>",
"     </p>",
"     <p>",
"      <a class=\"medical medical_basics\" href=\"UTD.htm?6/49/6931?source=see_link\">",
"       Patient information: Pacemakers (The Basics)",
"      </a>",
"     </p>",
"     <p>",
"      <a class=\"medical medical_patient\" href=\"UTD.htm?14/31/14834?source=see_link\">",
"       Patient information: Radiofrequency catheter ablation for the heart (Beyond the Basics)",
"      </a>",
