var title_f12_54_13160="Open cholecystectomy";
var content_f12_54_13160=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=SURG%2F73464&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=SURG%2F73464&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 547px\">",
"   <div class=\"ttl\">",
"    Open cholecystectomy",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 527px; height: 684px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    This figure depicts the general steps and principles to help guide safe open cholecystectomy.",
"    <br>",
"     Unequivocal identification of the cystic duct and cystic artery is critical in order to avoid injury to the common duct, right hepatic artery, and aberrant right hepatic branch duct. The \"critical view of safety\" must be achieved prior to the clipping or ligation of the cystic duct and artery. The critical view of safety is achieved by dissecting the triangle of Calot free of all tissue except for the cystic duct and cystic artery and by exposing the base of the liver bed by freeing the lower part of the gallbladder from the liver.",
"     <br>",
"      While most surgeons perform laparoscopic cholecystectomy \"from the bottom of the gallbladder (infundibulum) up,\" many surgeons perform open cholecystectomy from the \"top of the gallbladder (fundus or dome) down\" in order to avoid injury to major structures. The top down approach should always be used if there is uncertainty about the location of the cystic duct and artery in relation to other named structures in the hilum of the liver. If the surgeon has identified the cystic duct and artery with certainty, it should be equally safe to remove the gallbladder from the top down or from the bottom up. An \"anomalous\" cystic duct or cystic artery should not be divided until the surgeon is absolutely certain that the structure is not a major duct or artery.",
"      <div class=\"footnotes\">",
"      </div>",
"      <div class=\"reference\">",
"      </div>",
"     </br>",
"    </br>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
