var title_f12_54_13164="Gamblers anonymous survey";
var content_f12_54_13164=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PC%2F66405&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=5\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PC%2F66405&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=5\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Gamblers Anonymous 20 question survey",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td>",
"        1. Did you ever lose time from work due to gambling?",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        2. Has gambling ever made your home life unhappy?",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        3. Did gambling ever affect your reputation?",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        4. Have you ever felt remorse after gambling?",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        5. Did you ever gamble to get money with which to pay debts or otherwise solve financial difficulties?",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        6. Did gambling cause a decrease in your ambition or efficiency?",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        7. After losing, did you feel you must return as soon as possible and win back your losses?",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        8. After a win, did you have a strong urge to return and win more?",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        9. Did you often gamble until your lasts dollar was gone?",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        10. Did you ever borrow to finance your gambling?",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        11. Have you ever sold anything to finance your gambling?",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        12. Were you reluctant to use gambling money for normal expenditures?",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        13. Did gambling make you careless of yourself or your family?",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        14. Have you ever gambled longer than you planned?",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        15. Have you ever gambled to escape worry and trouble?",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        16. Have you ever committed or considered committing an illegal act to finance gambling?",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        17. Has gambling caused you to have difficulty in sleeping?",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        18. Have arguments, disappointment, or frustrations caused you to gamble?",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        19. Have you had an urge to celebrate any good fortune with a few hours of gambling?",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        20. Have you ever considered self-destruction as a result of your gambling?",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     Seven or more positive responses suggest pathologic gambling.",
"    </div>",
"    <div class=\"reference\">",
"     Data from Gamblers Anonymous International Service Office, Los Angeles, CA.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
